import styled from "styled-components"
import { TextMiddle } from "./styled";
import { Link } from "react-router-dom";

const Header = ({ page }) => {
    return (
        <HeaderBox>
          <HeaderCenterBox>
            <LogoBox><p>wanted</p></LogoBox>
            <LinkListBox>
              <LinkList><Link to=''>탐색</Link></LinkList>
              <LinkList><Link to=''>커리어 성장</Link></LinkList>
              <LinkList><Link to=''>직군별 연봉</Link></LinkList>
              <LinkList><Link to=''>이력서</Link></LinkList>
              <LinkList><Link to=''>매치업</Link></LinkList>
              <LinkList><Link to=''>프리랜서</Link></LinkList>
              <LinkList><Link to=''>AI 합격예측</Link></LinkList>
            </LinkListBox>
            <FlexRightBox>
              <SearchBox>
                <UserText>
                <svg viewBox="0 0 18 18" width='18' height='18'>
                    <path id="qt2dnsql4a" d="M15.727 17.273a.563.563 0 10.796-.796l-4.875-4.875-.19-.165a.563.563 0 00-.764.028 5.063 5.063 0 111.261-2.068.562.562 0 101.073.338 6.188 6.188 0 10-1.943 2.894l4.642 4.644z" />>
                </svg>
                </UserText>
              </SearchBox>
              <UserBox>
                <UserText>회원가입/로그인</UserText>
              </UserBox>
            </FlexRightBox>
          </HeaderCenterBox>
        </HeaderBox>
    )
}

const HeaderBox = styled.div`
  display: flex;
  width: 100%;
  height: 50px;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  background-color: #fff;
  box-shadow: 0 1px 0 0 rgb(0 0 0 / 10%);
  box-sizing: border-box;
`
const HeaderCenterBox = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-between;
  max-width: 1060px;
  width: 100%;
  height: 100%;

`

// Logo Box(FlexLeft)
const LogoBox = styled.div`
  font-size: 25px;
  line-height: 17px;
  font-weight: 800;
  text-decoration: none solid rgba(51,51,51);
`
// Link Box(Flex Center)
const LinkListBox = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
`
const LinkList = styled.div`
  font-size: 14px;
  line-height: 20px;
  font-weight: 600;
  padding: 15px;
  &:hover{
    border-bottom: 2px solid blue;
  }
;
`

// userBox(Flex Right)
const FlexRightBox = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
`
const SearchBox = styled.div`
  display: flex;
  justify-content: center;
`
const UserBox = styled.div`
  display: flex;
  justify-content: center;
`
const UserText = styled.div`
  height: 100%;
  padding: 0 10px;
  font-size: 14px;
  color: #333;
  font-weight: 600;
  line-height: 1;
`

export default Header

